import { Button, TextField } from "@mui/material";
import "./cadastro.css";

function Cadastro() {
  return (
    <div className="principalCadastro">
      <h2 style={{ marginBottom: "70px" }}>PÃ¡gina de cadastro</h2>
      <span style={{ marginRight: "182px", marginBottom: "10px" }}>E-mail</span>
      <TextField
        label="Digite seu email"
        style={{ width: "271px" }}
      ></TextField>
      <span
        style={{
          marginRight: "162px",
          marginBottom: "10px",
          marginTop: "10px",
        }}
      >
        Password
      </span>
      <TextField label="Digite a senha" type="password"></TextField>
      <span
        style={{
          marginRight: "162px",
          marginBottom: "10px",
          marginTop: "10px",
        }}
      >
        Password
      </span>

      <TextField label="Digite a senha novamente" type="password"></TextField>
      <Button variant="contained" style={{ marginTop: "10px", width: "271px" }}>
        Cadastrar
      </Button>
    </div>
  );
}

export default Cadastro;
